import Sidebar from "../../core/components/core-sidebar";
import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { ThemeProvider } from '@material-ui/styles';
import Grid from '@material-ui/core/Grid';
import theme from '../../theme';
import { Typography } from '@material-ui/core';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Emoji from '../../core/components/core-emoji';


const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',

    },
    logout: {
        backgroundColor: theme.palette.error.main,
        width: '148px',
        height: '46px',
        color: "#fff",
        fontSize: '24px',
        boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.25)',
        '&:hover': {
            backgroundColor: theme.palette.error.dark,
        },
    },
    logoutRow: {
        marginTop: '32px',
        marginRight: '50px',
        display: 'flex',
        justifyContent: 'flex-end',
        height: '%50',

    },
    text: {
        display: 'flex',
        textAlign: 'center',
        justifyContent: 'center',
        fontSize: '50px',
        fontWeight: 700,
    },
    checkins: {
        backgroundColor: "gray",
        color: "#fff",
    },
    card: {
        width: '256px',
        height: '130px',
        border: '1px solid #F2F2F2',
        borderRadius: 6,
        boxShadow: '0 8px 16px 0 rgba(0, 0, 0, 0.25)',
        overflow: 'hidden',
    },
    cardText: {
        fontSize: '18px',
    }
}));



function DashOrg() {
    const classes = useStyles();

    return (
        <ThemeProvider theme={theme}>
            <Grid container xs={12} className={classes.root}>
                <Grid container xs={2}>
                    <Sidebar></Sidebar>
                </Grid>
                <Grid container xs={10}>
                    <Grid item xs={12} className={classes.logoutRow}>
                        <Button className={classes.logout} variant="contained" size="large" color="error">Logout</Button>
                    </Grid>
                    <Grid className={classes.text} item xs={12}>
                        <Typography className={classes.text}>  Good afternoon, (user name here!)</Typography>
                    </Grid>
                    <Grid className={classes.text} item xs={12}>
                        <Grid item xs={6}>
                            <Grid item className={classes.checkins}>
                                <Typography variant="h1">Today's Check-ins:</Typography>
                                <Card className={classes.card}>
                                    <CardContent>
                                        <Typography className={classes.cardText}>
                                            <b>Last Check-in: 11:00 am</b>
                                        </Typography>
                                        <Typography className={classes.body}>
                                            Completed by: Becca Johnson
                                        </Typography>
                                        <Button variant="primary">Next</Button>
                                    </CardContent>
                                    <CardActions className={classes.action}>
                                        <Button variant="contained" color="primary">Start</Button>
                                    </CardActions>
                                </Card>
                            </Grid>
                        </Grid>
                        <Grid item xs={6}>
                            <Typography variant="h1"> Good afternoon, (user first name here)!</Typography>
                        </Grid>
                    </Grid>
                </Grid>


            </Grid>
        </ThemeProvider >

        /*                 
                        <Grid container xs={3}>
                            <Grid item xs={3}>
                        </Grid>
                        <Grid container xs={9}
                            <Sidebar></Sidebar>
                        </Grid>
                        <Grid item xs={9}></Grid>
                        <Grid item xs={12}>
                            <Grid className={classes.text} item xs={12}>
                                <Typography variant="h1"> Good afternoon, (user first name here)!</Typography>
                            </Grid>
                            <Grid className={classes.text} item xs={12}>
                                <Button className={classes.miniButtons} variant="contained" color="secondary">Back</Button>
                                <Button className={classes.miniButtons} variant="contained" disabled={"disabled"} color="primary">Next</Button>
                            </Grid>
                            <Button className={classes.logout} variant="contained" size="large" color="error">Logout</Button>
                        </Grid>
                    </Grid>
                    </Grid>
                </ThemeProvider > */

    );
}

export default DashOrg;
